import logo from './logo.svg';
import './App.css';


export function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
          <MysecondComponent />
        </p>

      </header>
    </div>
  );
}

export function MysecondComponent () {
  return <h1>I am Second Component</h1>
}

export default App;
